	var foodieApp = angular.module('foodieApp',['ngRoute']);              // initialize our Angular app and ngRoute module helps  application to be a SPA
	                                           // function:angular.module()- helps us  to add a list of modules that our app is dependent on
	console.log(foodieApp);



	foodieApp.config(function ($routeProvider) {                  //.config() - to set-up our app
	$routeProvider                                               //$routeProvider is an object defined in ngRoute
	.when('/',{                                                  //when() function defined in the $routeProvider object
		templateUrl: 'pages/login.html',
		controller: 'loginController'
	})
	.when('/home',{                                              //$routeProvider.when().when()-concept of Chaining
		templateUrl: 'pages/main.html',
		controller: 'mainController'
	})
	.when('/restaurant/:id', {
		templateUrl: 'pages/restaurant.html',
		controller: 'restaurantController'
	})
})


